import React from 'react';

export default function Skills() {
  const skills = ['React', 'JavaScript', 'HTML', 'CSS', 'Accessibility', 'Performance', 'ML/Research'];
  return (
    <section id="skills" className="container page">
      <h2 className="page-title">Skills</h2>
      <p className="lead">Tools and areas I work in.</p>

      <div style={{ marginTop: 18, display: 'flex', gap: 12, flexWrap: 'wrap' }}>
        {skills.map(s => (
          <span key={s} className="tag" style={{ background: 'rgba(249,115,22,0.08)', color: 'var(--accent)' }}>{s}</span>
        ))}
      </div>
    </section>
  );
}
